import React from 'react'

import ImageOne from '../Recursos/IMG_0496.jpg';
import ImageTwo from '../Recursos/IMG_1162.jpg';

function Content() {
    return (
        <div className='flex flex-col justify-center items-center bg-white h-screen font-mono py-40'>
            <img src={ImageOne} alt="" className="h-full rounded mb-20 shadow" />
            <div className='flex flex-col justify-center items-center'>
                <h2 className='text-2xl mb-2'>Vainilla Latte</h2>
                <p className="mb-2">La mejor calidad y el mejor proceso</p>

            </div>
        </div>
    )
}

export default Content
